# 136 ms
class Solution:
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        len_p = len(p)

        # rod ascii
        ord_p = [0] * 123
        for ch in p:
            ch_ord = ord(ch)
            ord_p[ch_ord] += 1

        ord_s = [0] * 123
        for ch in s[:len_p]:
            ch_ord = ord(ch)
            ord_s[ch_ord] += 1
        
        res = []
        if ord_s == ord_p:  res.append(0)
        for i in range(1, len(s)-len_p+1):
            l = ord(s[i-1])
            r = ord(s[i+len_p-1])
            ord_s[l] -= 1
            ord_s[r] += 1
            if ord_s == ord_p:  res.append(i)
        
        return res






s = "cbaebabacd"
p = "abc"

# s = "ababababab"
# p = "aab"

# s = ""
# p = ""

print(Solution().findAnagrams(s, p))



